import React, { Component } from "react";
import Carousel from "react-elastic-carousel";
import "./App.css";
import Card from "./Components/Card";
import Desktop from "./Components/Desktop";
//import Card from "./Components/Card";
class App extends Component {
  render() {
    return (
      <div className="App">
        <Desktop />
        <Carousel>
          <Card />
          <Card />
          <Card />
          <Card />
          <Card />
        </Carousel>
      </div>
    );
  }
}

export default App;
